Travis McGee is a fictional character, created by prolific American mystery writer John D. MacDonald. Unlike most detectives in crime fiction, McGee is neither a police officer nor a licensed private investigator; instead, he is a self-described &quot;salvage consultant&quot; who recovers others' property for a fee. McGee appeared in 21 novels, from The Deep Blue Good-by in 1964 to The Lonely Silver Rain in 1984. In 1980, the McGee novel The Green Ripper won the National Book Award.


